import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import {NgConnectModule} from "app/ng-connect";
import {RouterModule, Routes} from "@angular/router";
import { EditHardcopySeComponent } from './se-claim/edit-hardcopy-se/edit-hardcopy-se.component';
import { UserRouteAccessService } from 'app/core/auth/user-route-access.service';
import { CreateNewLetterComponent } from './pop-up/claim-letter/create-new-letter/create-new-letter.component';
import { ClaimLetterComponent } from './pop-up/claim-letter/claim-letter.component';
import { ChecklistItemComponent } from './pop-up/claim-letter/checklist-item/checklist-item.component';

const deductionRoutes: Routes = [

  {
    path: 'se-claim',
    loadChildren: () => import('./se-claim/se-claim.module').then(m => m.SEClaimModule),
  },
  {
    path: 'ec-claim',
    loadChildren: () => import('./ec-claim/ec-claim.module').then(m => m.ECClaimModule),
  },
  {
    path: 'claim',
    loadChildren: () => import('./claim.module').then(m => m.ClaimModule),
  },
  {
    path: 'pop-up',
    loadChildren: () => import('./pop-up/pop-up.module').then(m => m.PopUpModule),
  },
  // {
  //   path: 'claim-letter',
  //   component: ClaimLetterComponent,
  //   data: {
  //     pageTitle: 'nspay2App.claim.claim-letter.home.title'
  //   },
  //   canActivate: [UserRouteAccessService]
  // },
  // {
  //   path: 'create-new-letter',
  //   component: CreateNewLetterComponent,
  //   data: {
  //     pageTitle: 'nspay2App.claim.create-new-letter.home.title'
  //   },
  //   canActivate: [UserRouteAccessService]
  // },
  // {
  //   path: 'checklist-item',
  //   component: ChecklistItemComponent,
  //   data: {
  //     pageTitle: 'nspay2App.claim.checklist-item.home.title'
  //   },
  //   canActivate: [UserRouteAccessService]
  // },
];

@NgModule({
  imports: [RouterModule.forChild(deductionRoutes)],
  exports: [RouterModule] 
})
export class ClaimRoutingModule { }
